ingredient:
Vắt mì - Bột mì, dầu cọ, muối, chất làm dầy, chất tạo phức kim loại, chất ổn định, chất tạo xốp;
Gói gia vị - Muối, chất điều vị, bột tôm, tỏi, tiêu trắng, tiêu đen;
Gói dầu - Dầu cọ, hành tím, phẩm màu tổng hợp;
Gói sốt - Đậu nành, đường, muối, bột mì, đường nâu, phẩm màu tổng hợp, chất điều vị, chất bảo quản, bột tôm;
Gói rau - hành tím khô.
